     &           exep_eXee53m(2),ptep_eXee53m(4,3),
     &           evep_eXee20c(lepinv),eqep_eXee20c(4,lepinv)
      complex*16 cfep_eXee53m(2,4)
      complex*16 av6(lextrn*lextrn*lepina)
      complex*16 av7(lextrn*lintrn*lepina)
      complex*16 av8(lintrn*lextrn*lepinv)
      complex*16 av9(lextrn*lextrn*lepinv)
      complex*16 av10(lextrn*lextrn*lextrn*lintrn)
      complex*16 av11(lextrn*lepinv*lextrn*lextrn*lextrn)
      complex*16 atmp

      complex*16  av6r(lextrn*lextrn*lepina,4)
      integer     mu,ih
      complex*16     agcr(0:lep_eXeeag-1,4)
       common /RESO/ agcr

*-----------------------------------------------------------------------

* Denominators of propagators
      aprop = 1.0d0
      call snprpd(pphase,aprop,vnep_eXee11,
     &      ama**2,0.0d0)
      call snprpd(pphase,aprop,vnep_eXee53,
     &      amlp(1)**2,0.0d0)
      call snprpd(pphase,aprop,vnep_eXee20,
     &      amz**2,amz*agz)

* Internal momenta
      call smintv(lepina,ama,pfep_eXee11,eqep_eXee11d,evep_eXee11d,
     &            vnep_eXee11,igauab)
      call smintf(amlp(1),pfep_eXee53,vnep_eXee53,exep_eXee53m,
     &            ptep_eXee53m,cfep_eXee53m)
      call smintv(lepinv,amz,pfep_eXee20,eqep_eXee20c,evep_eXee20c,
     &            vnep_eXee20,igauzb)

* Vertices (10)

*     6(0): pfep_eXee9 xxx
*     6(1): pfep_eXee2 p
*     6(2): pfep_eXee11 photon
      call stpxv(2212,lextrn,amp,pfep_eXee2,+1,vnep_eXee2,exep_eXee2v,
     &            cfep_eXee2v,ptep_eXee2v,2212,lextrn,amp,pfep_eXee9,-1,
     &            vnep_eXee9,exep_eXee9x,cfep_eXee9x,ptep_eXee9x,22,
     &            lepina,ama,pfep_eXee11,+1,vnep_eXee11,exep_eXee11d,
     &            eqep_eXee11d,capx,lt6,av6r)

*     7(0): pfep_eXee53 electron
*     7(1): pfep_eXee62 electron
*     7(2): pfep_eXee11 photon
      call smffv(lextrn,lintrn,lepina,exep_eXee62m,exep_eXee53m,amlp(1),
     &           amlp(1),call(1,1),cfep_eXee62m,cfep_eXee53m,
     &           ptep_eXee62m,ptep_eXee53m,eqep_eXee11d,lt7,av7)

*     8(0): pfep_eXee33 electron
*     8(1): pfep_eXee53 electron
*     8(2): pfep_eXee20 z
      call smffv(lintrn,lextrn,lepinv,exep_eXee53m,exep_eXee33m,amlp(1),
     &           amlp(1),czll(1,1),cfep_eXee53m,cfep_eXee33m,
     &           ptep_eXee53m,ptep_eXee33m,eqep_eXee20c,lt8,av8)

*     9(0): pfep_eXee4 electron
*     9(1): pfep_eXee17 electron
*     9(2): pfep_eXee20 z
      call smffv(lextrn,lextrn,lepinv,exep_eXee17m,exep_eXee4m,amlp(1),
     &           amlp(1),czll(1,1),cfep_eXee17m,cfep_eXee4m,
     &           ptep_eXee17m,ptep_eXee4m,eqep_eXee20c,lt9,av9)

      sym = + 1.0d0
      cf  = + 1.0d0
      aprop         = cf*sym/aprop

      do 4000 mu=1,4   !!!!!!!!!!!!!!!!!!!!!!!!! 

      do ih = 1, lextrn*lextrn*lepina
        av6(ih) = av6r(ih,mu)
      enddo

      call smconv(lt6,lt7,3,3,evep_eXee11d,av6,av7,lt10,av10)
      call smconf(lt8,lt10,1,4,exep_eXee53m,av8,av10,lt11,av11)
      call smconv(lt9,lt11,3,2,evep_eXee20c,av9,av11,lt,av)

      indexg(1) = 4
      indexg(2) = 2
      indexg(3) = 5
      indexg(4) = 1
      indexg(5) = 3
      indexg(6) = 6

      call aep_eXeempord(lt, av, indexg, agcwrk)

      ancp(jgraph) = 0.0d0
*     nbase = 1
      do 500 ih = 0 , lep_eXeeag-1
         atmp    = agcwrk(ih)*aprop
         agc(ih) = agc(ih) + atmp
         agcr(ih,mu) = agcr(ih,mu) + atmp
         ancp(jgraph) = ancp(jgraph) + atmp*conjg(atmp)
  500 continue

 4000 continue         !!!!!!!!!!!!!!!!!!!!!!!!! 

      return
      end
